import React from "react";

const Overview = ({ quoteSummary }) => {
  const displayOverview = (
    <>
      <div className="row">
        <div className="col-6">
          <div className="text-primary">
            {quoteSummary
              ? quoteSummary?.quoteType.symbol.replace(".BK", "")
              : "-"}
          </div>
          <div>{quoteSummary ? quoteSummary?.quoteType.longName : "-"}</div>
        </div>
        <div className="col-2">
          <div>
            {quoteSummary ? quoteSummary?.financialData.currentPrice.fmt : "-"}{" "}
            บาท
          </div>
          <div>ราคาตลาด</div>
        </div>
        <div className="col-2">
          <div>
            {quoteSummary ? quoteSummary?.summaryDetail.marketCap.fmt : "-"}
          </div>
          <div>มูลค่าตลาด</div>
        </div>
        <div className="col-2">
          <div>
            {quoteSummary
              ? quoteSummary.defaultKeyStatistics["52WeekChange"].fmt
              : "-"}
          </div>
          <div>ผลตอบแทน 1 ปี</div>
        </div>
      </div>
    </>
  );

  return <div className="my-4">{quoteSummary ? displayOverview : ""}</div>;
};

export default Overview;
